import styled from "styled-components";

export const Container = styled.div`
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  padding: 15px;
`;

export const Content = styled.div`
  margin: 0 16.66%;
  margin: 0 calc(100% / 6);
`;
